import React from 'react';

import { Container, Row, Col } from 'react-bootstrap'
import CurrentWeather from './components/CurrentWeather';
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Col sm={4}><CurrentWeather /></Col>
          <Col sm={8}>2 of 2</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
